<ul>
<li>RDD是只读的，表示它的不可变性。</li>
<li>可以并行的操作分区集合上的所有元素。</li>
<li>天生具有容错机制的特殊集。</li>
<li>只能通过在稳定的存储器或其他RDD上的确定性操作（转换）来创建。</li>
</ul>
